import User from '../core/User'

export default class UserMapper {
    static convertToUser(json) {
        return new User({
            id: json.data.id,
            firstName: json.data.userInfos.firstName,
            lastName: json.data.userInfos.lastName,
            age: json.data.userInfos.age,
            score: json.data.todayScore,
        })
    }
}
